import React from 'react'

//import Beneficiarios from '../components/Beneficiario'
import axios from 'axios'

const listData = [];
for(let i = 0; i < 5; i++)
{
    listData.push({
        nombre: 'Trash'
    });
}

class BeneficiarioList extends React.Component {
    state = {
        beneficiarios: []
    }

    componentDidMount() {
        axios.get('http://127.0.0.1:8000/api/')
            .then(res => {
                this.setState({
                    beneficiarios: res.data
                });
                console.log(res.data);
            })
    }

    render()
    {
        return (
            //<Beneficiarios data={this}/>
            <List>
                {this.state.beneficiarios.map(item => {
                    return (
                    <ListItem key={item.id} button>
                        <ListItemText primary={item.nombre}/>
                    </ListItem>
                );
                    })}
            </List>
        )
    }
}

export default BeneficiarioList;
